function support_init(){$(document).find("#form_support").on("submit",function(){var e=new Object;e.token=session_key,e.text=$(document).find("#form_support textarea").val(),e.user_email=user.email,$.ajax({url:site_url+"api/support/",data:e,method:"POST"}).fail(function(e){return console.log(e),app_status(e),!1}).done(function(e){return console.log(e),app_status(e,1),!1});var t={};return t.user_name=user.name,t.user_lastName=user.lastName,t.user_email=user.email,t.app="app",t.telegram_bot="0",t.messages=$(this).find('[name="text"]').val(),$.ajax({url:"/app/app.php",data:t,method:"POST"}).fail(function(e){return console.log(e),app_status(e),!1}).done(function(e){return console.log(e),app_status(e,1),!1}),!1})}